INSERT INTO `books` VALUES (1,'9787221149244','《桃李春风杯酒》','中国','三十万以上','领略诗词之美','中国古诗词','每个诗人都是自己的传奇，每首诗词都有它的故事。','叶楚桥',1608779208852,3),(2,'9787540493653','《骆驼祥子》','中国','十万到二十万','领略诗词之美','中国古诗词','一首首名篇背后有怎样的故事？一个个大咖如何快意恩仇、神采飞扬？\n换个角度读诗词，会发现不同的诗意。','马子阳',1608779208852,2),(3,'9787538761399','《梦里不知身是客》','中国','三十万以上','领略诗词之美','中国古诗词','本书采用“词人 作品”的方式，以重大历史事件为背景，演绎全宋19位*代表性词人的传奇人生，写尽悲欢离合、荣辱浮沉以及国仇家恨，重回风云变幻的大宋。','叶楚桥',1608779208852,4),(4,'9787532177172','《半小时漫画唐诗2》','中国','十万以内','领略诗词之美','中国古诗词','通过手绘漫画和段子，陈磊（笔名：二混子）领衔的半小时漫画团队带我们重新读懂了那些从小背到大的宋词。','陈磊',1608779208852,2),(5,'9787550249691','《人间词话》','中国','二十万到三十万','领略诗词之美','中国古诗词','用传统的词话形式及传统的概念、术语和思维逻辑，较为自然地融进了一些新的观念和方法，其总结的理论问题又具有相当普遍的意义，这就使它在当时新旧两代的读者中产生了重大反响','王国维',1608779208852,3),(6,'9787551816991','《诗经》','中国','十万以内','领略诗词之美','中国古诗词','以《毛诗正义》为底本，辅以其它版本全新精校。收录全305篇。','骆玉明',1608779208852,4),(7,'9787553322230','《飞花令里读诗词》','中国','十万到二十万','领略诗词之美','中国古诗词','飞花令源自古人的诗词之趣，诗词之美，美在情感之真纯，亦美在表达之深刻。','琬如',1608779208852,5),(8,'9787108060334','《古诗词课:叶嘉莹讲古诗词》','中国','十万到二十万','领略诗词之美','中国古诗词','叶嘉莹先生全面讲解中国古诗词，涵盖中国*重要的诗人和诗歌，带读者走进古典诗歌美好、高洁的世界。','叶嘉莹',1608779208852,1),(9,'9787514516838','《唐诗里的烟火人间》','中国','三十万以上','领略诗词之美','中国古诗词','微信知乎历史大神温伯陵，击碎对唐朝诗人的刻板印象，带你全面了解唐朝诗人，讲述隐藏在唐诗背后的故事。','温伯陵',1608779208852,3),(10,'23575211','《蒋勋说唐诗（修订版）》','中国','二十万到三十万','领略诗词之美','中国古诗词','只要人还追求心灵的自由，便一定会热爱诗歌。','蒋勋',1608779208852,4),(11,'YH0123456789','《樊登讲论语：学而》','中国','二十万到三十万','领略诗词之美','中国古诗词','樊登全新重磅作品！四千万读书人信赖的领读人樊登，打通东西方文化壁垒，援引中西经典书籍，站在应用的角度讲透《论语》。','樊登',1608778856298,3),(12,'YH9787111590','《稻盛和夫经营学》','日本','三十万以上','经营','经济','2020年新版！新增作译者序及彩色插页，精美漫画图示稻盛经营学内容体系。学经营读稻盛和夫!','稻盛和夫',1608778856298,2),(13,'YH9787520715','《幕后大脑》','日本','十万到二十万','经营','经济','.广告界大师级别人物陈耀福、胡湘云、林桂枝、李西沙、莫康孙、宋秩铭、滕丽华、叶明桂、郑以萍联袂推荐！','丁和珍',1608778856298,3),(14,'YH9787547317','《海底捞店长日记》','俄罗斯','十万以内','经营','经济','《海底捞店长日记》行销20多万册，为大家呈现了一个普通人如何在一家成长型很强的公司里自我蜕变的历程，在平凡的岗位上如何迈向卓越的历程。','李顺军',1608778856298,3),(15,'YH9787510893','《伟大的商业游戏》','美国','二十万到三十万','经营','经济','经营模式颠覆式创新的典范，开卷式管理的开山之作！《纽约时报》经典畅销管理类图书， CEO应该阅读的100部商业图书之一','杰克·斯塔克',1608778856298,2),(16,'YH9787511737','《经营哲学与进阶逻辑》','俄罗斯','十万到二十万','经营','经济','我们会不会失业？做正确的事，还是正确的做事，知行合一是对的吗？市场边界的背后，不能忽视的经营关键词。','刘文涛',1608778856298,3),(17,'YH9787213094','《5G时代》','日本','三十万以上','经济学','经济','5G商用正式开启，一本书讲透5G对生活和商务的影响 继《大数据时代》，重磅推出畅销书《5G时代》','龟井卓也',1608778856298,2),(18,'YH9787521714','《价格的发现》','美国','十万以内','经济学','经济','2020年诺贝尔经济学奖得主保罗·米尔格罗姆著作！ 三位诺奖得主联袂推荐！ 这是一本由成功的复杂拍卖设计者撰写的具有开创性的实用经济著作','保罗·米尔格罗姆',1608778856298,3),(19,'YH9787100011','《关于财富的形成和分配的考察》','法国','十万以内','经济学','经济','论述了各种耕作方法的变迁、交换和货币的性质以及资本的运用方法等等，从而创立了所谓“单一地租税”的理论。','杜阁',1608778856298,4),(20,'YH2400472356','《魔鬼经济学》','美国','三十万以上','经济学','经济','江湖奇书！聪明人怎样看世界？怎样成为一个有趣的人？逃出认知囚笼，打破惯性思维，以反常思维理性解决看似不可能解决的问题。','史蒂芬·列维特',1608778856298,3),(21,'9787501614592','《草房子》','法国','二十万到三十万','回到童真年代','儿童文学','男孩桑桑在油麻地小学度过了六年刻骨铭心、终身难忘的校园生活，亲眼目睹或直接演绎了一个个看似寻常但又催人泪下、震撼人心的故事','曹文轩',1608779208852,3),(22,'9787556092406','《猫的风工厂》','美国','二十万到三十万','回到童真年代','儿童文学','在离小镇不远的小山坡上有一个带有大圆筒的工厂，吹向小镇的风都是从这个工厂里生产出来的。你可能想象不到，在工厂里工作的竟然是一群小猫','水野良惠',1608779208852,5),(23,'9787553671413','《流浪的地球》','俄罗斯','十万到二十万','回到童真年代','儿童文学','小说讲述了太阳即将变成红巨星，毁灭全太阳系里的行星，人类启动庞大的地球逃脱计划，在地球的一侧安装上巨大的地球发动机，将整个巨大地球环境圈化为的移民方舟，逃离太阳系，寻找新家园。','刘慈欣',1608779208852,2),(24,'9787500158547','《小灵通漫游未来》','俄罗斯','十万以内','回到童真年代','儿童文学','作者在这本前后历时四十多年所写的作品中，塑造了眼明心亮的小记者小灵通的可爱形象。','叶永烈',1608779208852,1),(25,'9787501607846','《青铜葵花》','俄罗斯','二十万到三十万','回到童真年代','儿童文学','以纯净、优美的童年之歌吟咏苦难与优雅的纯美之作，男孩青铜，女孩葵花，正在岁月流逝中走向永恒……','曹文轩',1608779208852,4),(26,'9787534256301','《狼王梦》','日本','二十万到三十万','动物小说','儿童文学','本书写的是一匹充满智慧的狼，用一生的时间来完成自己的梦想。','沈石溪',1608779208852,2),(27,'23908638','《皮皮鲁和鲁西西魔方系列》','法国','十万到二十万','动物小说','儿童文学','这是皮皮鲁上中学后遇到的第一件有趣的事。这件事情的全部意义，皮皮鲁现在还无法估计。','郑渊洁',1608779208852,3),(28,'23521768','《歪歪兔独立成长童话》','美国','十万到二十万','动物小说','儿童文学','这套童话不同于流行的“口水体”儿童文学，语言优美，故事精彩，想象奇特，对学龄前后儿童的语文能力培养十分有帮助','歪歪兔',1608779208852,4),(29,'23504060','《小猪唏哩呼噜》','美国','二十万到三十万','动物小说','儿童文学','他唏哩呼噜是中国儿童文学史上著名的一只小猪。因为他吃东西的时候，总是头也不抬地“唏哩呼噜、唏哩呼噜”一片响，所以就叫了这个名字。','孙幼军',1608779208852,5),(30,'9787531578581','《小狐狸买手套》','日本','二十万到三十万','动物小说','儿童文学','《小狐狸买手套》是金钥匙儿童文学大系中的一本，本书收录日本著名童话作家新美南吉的经典童话四十篇。',' 新美南吉',1608779208852,1),(31,'YH7521706529','《养育男孩》','俄罗斯','十万以内','家教理论','家教','教你如何抓住男孩成长的3个关键阶段，培养积极勇敢、有担当的男孩','史蒂夫·比达尔夫',1608778856298,3),(32,'YH7506376631','《好妈妈胜过好老师》','中国','二十万到三十万','家教理论','家教','《好妈妈胜过好老师》堪称中国家庭教育里程碑之作，既有国际视野，又具中国文化精髓，紧贴现实，呈现了优质教育的做法和魅力，首次把家庭教育著作提升到专业化水平。','尹建莉',1608778856298,2),(33,'YH7505748736','《陪孩子终身成长》','法国','二十万到三十万','家教理论','家教','.影响40,000,000人的领读人樊登给所有渴望与孩子一起成长的父母：用无条件的爱、价值感、终身成长的心态，陪孩子成长为有生命力的森林。','樊登',1608778856298,3),(34,'YH8752170312','《未来学校：重新定义教育》','俄罗斯','十万以内','家教理论','家教','新教育实验发起人朱永新对未来教育趋势做出了预判:今天的学校会被未来的学习中心取代。主动迎接、主动介入通往未来的教育趋势。','朱永新',1608778856298,3),(35,'YH7875127190','《培养孩子的社会情商》','法国','二十万到三十万','家教理论','家教','47个教养细节培养孩子的社会能力，提升孩子的社会情商。','叶如风',1608778856298,2),(36,'YH8712135197','《疯狂Python讲义》','中国','三十万以上三十万以上','编程','计算机','零基础学Python编程实战，CSDN爆款Python课程官方用书，覆盖爬虫、大数据、并发编程等就业热点，Python求职不再慌','李刚',1608778856298,3),(37,'YH7871213310','《疯狂Java讲义》','中国','十万以内','编程','计算机','10年经典原创读物，覆盖Java 8，Java 9，李刚作品成为50万读者之选','李刚',1608778856298,2),(38,'YH8711166128','《迁移学习》','中国','十万以内','编程','计算机','杨强教授领衔撰写，迁移学习“开山之作”，解决人工智能的“zui后一公里”问题。','杨强',1608778856298,3),(39,'YH7871213847','《超级搜索术》','中国','三十万以上','编程','计算机','知名私人学习教练首部搜索力作！有趣、有料，还有范儿的信息素养提升书！格调人士高品位搜索入门和进阶读物！信息达人不容错过的经典之作！','朱丹',1608778856298,4),(40,'YH9787302538','《知识图谱与深度学习》','中国','二十万到三十万','编程','计算机','清华大学人工智能研究院孙茂松教授团队研究成果，展现数据驱动的深度学习与符号表示的知识图谱间相互补充和促进，对人工智能研究具参考意义。','刘知远',1608778856298,3),(41,'YH7030652003','《你的身体适合怀孕吗？》','日本','十万到二十万','中医','医学','由北医三院刘湘源教授领衔翻译，全面阐述免疫原因导致的妊娠障碍，解答“不明原因”的不孕、流产等原因，提供可行的排查及治疗方法，助您轻松当上好孕妈妈！','刘湘源',1608778856298,3),(42,'YH8757230672','《内经日历》','中国','十万到二十万','中医','医学','《黄帝内经》为中医学术之根，堪称“至道之宗，奉生之始”。传世《黄帝内经》含《素问》《灵枢》两部分，今摘取其中重要语句编为《内经日历》。','刘更生',1608778856298,3),(43,'YH9787302538','《神农本草经译释》','中国','十万以内','中医','医学','《神农本草经译释》的编写是在广泛参考历代对《神农本草经》的整理和研究基础上进行的。全书分两大部分，*部分为注释部分，是从整体上对《神农本草经》的解读。','张瑞贤',1608778856298,3),(44,'YH7871172873','《中国营养科学全书》','中国','三十万以上','中医','医学','本书包含了营养科学各个领域的知识，适合营养专业及相关领域的研究人员、教学人员和学生学习与参考。','杨月欣',1608778856298,3),(45,'YH7875710033','《太阳与中医》','中国','十万以内','中医','医学','以太阳历为基础，中华先贤创造出了中华文化与中医文化，故此太阳历具有中医文化的基础性要素全部具有的规定性与无限循环性。','刘明武',1608778856298,3);
